import React from "react";
import { Button, Container, Row, Col } from "react-bootstrap";
import Navbar from "./Navbar";
import Footer from "./Footer";
import customer from "../Images/customer.png";
import chef from "../Images/chef.jpeg";
import owner from "../Images/Owner.jpeg";
import { useNavigate } from "react-router-dom";

export default function Login() {
  const navigateTo = useNavigate();

  return (
    <div className="bg-orange-300 min-h-screen">
      <Navbar />
      <Container className="mt-5">
        <Row className="justify-content-center">
          <Col sm={4}>
            <Button
              onClick={() => {
                navigateTo("/SignInPage");
              }}
              className="rounded-circle w-100 p-4 bg-gray-400 text-white"
            >
              <img
                className="rounded-circle w-100"
                src={customer}
                alt="Customer"
              />
            </Button>
            <h1 className="text-center mt-2">Customer</h1>
          </Col>
          <Col sm={4}>
            <Button
              onClick={() => {
                navigateTo("/SignInPage");
              }}
              className="rounded-circle w-100 p-4 bg-gray-400 text-white"
            >
              <img
                className="rounded-circle w-100"
                src={chef}
                alt="Chef"
              />
            </Button>
            <h1 className="text-center mt-2">Chef</h1>
          </Col>
          <Col sm={4}>
            <Button
              onClick={() => {
                navigateTo("/SignInPage");
              }}
              className="rounded-circle w-100 p-4 bg-gray-400 text-white"
            >
              <img
                className="rounded-circle w-100"
                src={owner}
                alt="Owner"
              />
            </Button>
            <h1 className="text-center mt-2">Owner</h1>
          </Col>
        </Row>
      </Container>
      <Footer />
    </div>
  );
}
